r($,"aLl","aml",()=>{var q=u.x,p="Shiraz University of Medical Sciences",o=u.k,n="Journal of Physics: Conference Series",m="Utomo, Trio Pambudi; Nuryani, Nuryani;",l=t.N,k=t.z
return A.a([A.ag(["authors",u.n,"title",u.a,"publication",q,"volume","","number","","pages","","year","2023","publisher",p,"keywords",u.z,"link",u._,"abstract",u.r],l,k),A.ag(["authors","Octaviani, Aulia; Nuryani, Nuryani; Salamah, Umi; Utomo, Trio Pambudi;","title","Heart Rate Variability of Photoplethysmography for Hypertension Detection Using Support Vector Machine","publication","Proceeding of the 3rd International Conference on Electronics, Biomedical Engineering, and Health Informatics: ICEBEHI 2022, 5-6 October, Surabaya, Indonesia","volume","","number","","pages","463-473","year","2023","publisher","Springer Nature Singapore Singapore","keywords","Hypertension detection; Heart rate variability; Support vector machine; Photoplethysmography","link","https://doi.org/10.1007/978-981-99-0248-4_31","abstract","Early detection of hypertension is essential as it is a common chronic age-related disease often associated with debilitating cardiovascular complications. The aim of this article is to find the best accuracy performance in detecting hypertension. This article introduced a method for hypertension detection without a cuff using parameters of photoplethysmography (PPG) and support vector machine (SVM). The parameters were heart rate variability (HRV) of PPG. Both the time domain and frequency domain of HRV were utilized. The HRV was obtained from the respiratory rate (RR) interval of PPG, which was the time interval between two consecutive peaks of PPG. An SVM with a radial basis function (RBF) was used. SVM parameters were tuned to find the optimal one. Furthermore, a feature selection of PPG-HRV was conducted to find appropriate features. Experiments using clinical data showed that SVM with HRV of PPG resulted in a good performance for hypertension detection. The performance of hypertension detection with different values of SVM parameters and different features of HRV was presented. This method found accuracies of 98.89 and 80.68% for training and testing, respectively. Based on the results, the use of HRV from PPG is quite effective and can contribute to medical development to detect hypertension."],l,k),A.ag(["authors",u.m,"title",u.g,"publication",q,"volume","12","number","6","pages","627-636","year","2022","publisher",p,"keywords",u.A,"link",u.E,"abstract",u.w],l,k),A.ag(["authors",o,"title",u.L,"publication",u.d,"volume","11","number","5","pages","641","year","2021","publisher",p,"keywords",u.R,"link",u.t,"abstract",u.s],l,k),A.ag(["authors","Utomo, Trio Pambudi; Nuryani, N;","title",u.D,"publication",n,"volume","1825","number","1","pages","12032","year","2021","publisher","IOP Publishing","keywords","Photoplethysmogram; Peak detection; Heart rate;; Android smartphone; Moving window integration; Threshold; Accuracy; Sensitivity; Positive predictive","link","https://doi.org/10.1088/1742-6596/1825/1/012032","abstract","We present a photoplethysmogram peaks detection and heart rate calculation on android smartphone. Photoplethysmogram signal is obtained and extracted from a video stream of fingertip that is taken from smartphone camera. Then, photoplethysmogram peak is detected based on moving window integration and threshold. The heart rate value is calculated from the detected peak. We design an Android Application for processing photoplethysmogram data and calculating the Heart Rate. The photoplethysmogram signal and detected peak could be saved in smartphone's storage and uploaded to the existing database. Peak detection and peak to peak time interval calculation are successfully conducted. The performance of the peak detection is calculated in terms of accuracy, sensitivity, and positive predictive. Positive predictive, accuracy, and sensitivity of peak detection are 99.19%, 92.45%, 93.17%, respectively."],l,k),A.ag(["authors","Septiyani, Friescha; Nugroho, Anto Satriyo; Indrawati, Aida Noor; Utomo, Trio Pambudi;","title","Fetal Electrocardiogram Extraction From Abdominal Electrocardiogram Using Wavelet","publication","The 2nd International Seminar on Science and Technology (ISSTEC 2019)","volume","","number","","pages","218-223","year","2020","publisher","Atlantis Press","keywords","Fetal; Electrocardiogram; Abdominal; Wavelet","link","https://doi.org/10.2991/assehr.k.201010.032","abstract","Fetal electrocardiogram (FECG) is a signal from an abdominal electrocardiogram (AECG), obtained using non-invasively. FECG is very important to find the situation of fetal health. This article presents a method for FECG extraction from the AECG signal employing Wavelet. Wavelet is used to remove the noise of muscle and fetal movements in the mother's abdomen. Parts of the wavelet result are eliminated such that the signal only consists of QRS fetal. The method is examined using the dataset of the abdominal database from the Physionet. The performance found using this method is 95.01% in terms of accuracy."],l,k),A.ag(["authors","Hendra, Muhammad; Kurniawan, Danang; Chrismiantari, Riza Vina; Utomo, Trio Pambudi; Nuryani, Nuryani;","title","Drowsiness detection using heart rate variability analysis based on microcontroller unit","publication",n,"volume","1153","number","1","pages","12047","year","2019","publisher","IOP Publishing","keywords","Drowsiness; Driver; Electrocardiogram; Heart rate variability; Microcontroller unit; Driving simulator; Radial basis function neural network","link","https://doi.org/10.1088/1742-6596/1153/1/012047","abstract","Drowsiness is one of the main cause of road accidents. Recently, drowsiness detection of driver based on biosignal like electrocardiogram is being studied. Alterations during drowsiness, fatigue, and stress of the driver can be obtained from heart rate variability (HRV). HRV is derived from interval of RR in electrocardiogram. In this article, we present drowsiness detection using HRV analysis based on microcontroller unit. Electrocardiogram signal is obtained by AD8232 module and processed in microcontroller unit. Electrocardiogram is recorded during the subject using driving simulator. We extract features from HRV and use radial basis function neural network to classify between drowsy and normal."],l,k),A.ag(["authors","Shalihah, Ariefah; Alhafid, Fahmi; Subekti, Nanda Yudi Shofi; Utomo, Trio Pambudi; Nuryani, Nuryani;","title","Electrocardiogram monitoring system based on Android smartphone and microcontroller unit","publication",n,"volume","1153","number","1","pages","12048","year","2019","publisher","IOP Publishing","keywords","Electrocardiogram; Heart disease; Early diagnosis","link","https://doi.org/10.1088/1742-6596/1153/1/012048","abstract","Disease of the heart is one of the death main cause in the world. Special attention to prevent more deaths from the heart disease is needed; one of them is early diagnose for heart disease with electrocardiogram (ECG). ECG represent electrical activity of the heart. The heart's electrical activity can be recorded using some electrodes that is placed on certain body's surface. ECG records can be used to determine abnormalities of the heart. We design a ECG monitoring system based on android smartphone and microcontroller unit. The ECG signal is obtained directly from patient using AD8232 module. Then, ECG signal is processed in microcontroller unit. Furthermore, the ECG signal is sent to Android smartphone and displayed in this device. We analyse the abnormalities of the heart using the heart rate from ECG signal. Heart rate is obtained from RR-interval in the ECG which represent the time interval between two detected R peak. We use modified Pan-Tompkins algorithm to detect the peak of R wave. The device that we design give good performance to detect and analyse abnormalities of the heart using heart rate."],l,k),A.ag(["authors",o,"title",u.i,"publication",n,"volume","1153","number","1","pages","12039","year","2019","publisher","IOP Publishing","keywords","QRS complex; Moving average; Thresholding","link","https://doi.org/10.1088/1742-6596/1153/1/012039","abstract","In this article, we present QRS-complex peak detection using moving average and thresholding process. In the QRS-complex detection, electrocardiogram (ECG) signal is detrended to remove the baseline shift of the signal. Detrended ECG signal is passed through band pass filter that consist of low pass and high pass filter to remove various noises that present in the signal. The output of ECG signal from filtering process is differentiated to provide the slope of QRS-complex. To make all ECG data point positive, derived ECG signal is processed by squaring process. The final process to detect QRS-complex is passing the ECG signal to moving average and thresholding process. We use ECG data that taken directly from patient with AD8232. The signal that is obtained from AD8232 is processed in Arduino UNO. Processed signal is sent to Android Smartphone and recorded in this device. The accuracy, positive predictive, and sensitivity of QRS-complex detection are 98.28%, 99.01%, and 99.26%, respectively."],l,k),A.ag(["authors",m,"title",u.u,"publication","AIP Conference Proceedings","volume","2014","number","1","pages","20033","year","2018","publisher","AIP Publishing LLC","keywords","QT interval; Electrocardiogram","link","https://doi.org/10.1063/1.5054437","abstract","The aim of this study is to propose a method to measure QT interval of electrocardiogram (ECG). Firstly, in this proposed QT interval measurement, the P-wave and QRS complex of ECG signal is removed to detect the T end. Then, the ECG signal is passed through differentiated process. T end is defined as point where last maximum or minimum differentiated signal reaches the threshold value. Threshold value is variated with 5% (TH1), 10% (TH2), and 50% (TH3) of last maximum or minimum value of differentiated signal. The proposed method is compared to reference measurement that provided by Physionet QT Database. The proposed algorithm has been evaluated using clinical data which is 10 ECG records in the Physionet QT Database. Mean difference of proposed QT interval measurement and reference QT interval measurement are 15.4 - 25.7 ms for TH1, 18.1 - 25.7 ms for TH2, and 38.2 - 25.6 ms for TH3."],l,k),A.ag(["authors",m,"title",u.B,"publication",n,"volume","909","number","1","pages","12006","year","2017","publisher","IOP Publishing","keywords","Android smartphone; Heart rate monitoring; Electrocardiogram; QRS peak detection","link","https://doi.org/10.1088/1742-6596/909/1/012006","abstract","In this study, Android smartphone is used for heart rate monitoring and displaying electrocardiogram (ECG) graph. Heart rate determination is based on QRS peak detection. Two methods are studied to detect the QRS complex peak; they are Peak Threshold and Peak Filter. The acquisition of ECG data is utilized by AD8232 module from Analog Devices, three electrodes, and Microcontroller Arduino UNO R3. To record the ECG data from a patient, three electrodes are attached to particular body's surface of a patient. Patient's heart activity which is recorded by AD8232 module is decoded by Arduino UNO R3 into analog data. Then, the analog data is converted into a voltage value (mV) and is processed to get the QRS complex peak. Heart rate value is calculated by Microcontroller Arduino UNO R3 uses the QRS complex peak. Voltage, heart rate, and the QRS complex peak are sent to Android smartphone by Bluetooth HC-05. ECG data is displayed as the graph by Android smartphone. To evaluate the performance of QRS complex peak detection method, three parameters are used; they are positive predictive, accuracy and sensitivity. Positive predictive, accuracy, and sensitivity of Peak Threshold method is 92.39%, 70.30%, 74.62% and for Peak Filter method are 98.38%, 82.47%, 83.61%, respectively."],l,k)],t.H7)})
